document.addEventListener(
	'DOMContentLoaded',
	() => {
		const editLinks = document.querySelectorAll('.prc-block-area__edit-link');
		editLinks.forEach((editLink) => {
			const a = editLink.querySelector('a');
			a.addEventListener('mouseover', () => {
				const area = editLink.closest('.prc-block-area');
				area.classList.add('editor-link-is-hovering');
			});
			a.addEventListener('mouseout', () => {
				const area = editLink.closest('.prc-block-area');
				area.classList.remove('editor-link-is-hovering');
			});
		});
	},
	false,
);
